import React from 'react';

import { Container, Wrapper, ListaMenu, Link } from './styles';

function Header() {
  return(
    <Container>
      <Wrapper>
          <h1>Forniture</h1>

          <nav>
              <ListaMenu>
                  <Link>Home</Link>
                  <Link>About</Link>
                  <Link>Contact</Link>
                  <Link>Contact</Link>
                  <Link>Contact</Link>
                  <Link>Contact</Link>
              </ListaMenu>
          </nav>
      </Wrapper>
    </Container>
  );
}

export default Header;
